import React from 'react';
import SmallCard from './SmallCard';
import foto_3 from '../assets/images/foto_home_3.png';

let productInDataBase = {
    color:   "danger",
    titulo: "Nuestros Productos",
    icono: <img className="img-profile" src={foto_3} width="60" alt='Imagen arte'/>,
    moneda: false 
}


let amount ={
    color:   "success",
    titulo: "Nuetsras Ofertas",
    valor: 546,
    icono: "fa-dollar-sign",
    moneda: true
}

let user = {
    color:   "warning",
    titulo: "Users quantity",
    valor: 38,
    icono: "fa-user-check",
    moneda: false
}

let cardProps = [productInDataBase,amount,user];


function ContentRowTop(){
    return (
        <React.Fragment>
        {/*<!-- Content Row -->*/}
        <div className="row">
            {
                cardProps.map((producto,index)=>{
                    return <SmallCard  {...producto}  key= {index}/>
                })
            }      
        </div>
        </React.Fragment>
    )
}
export default ContentRowTop;
